"H5052":{"lemma":"נֹגַהּ","xlit":"Nôgahh","pron":"no'-gah","derivation":"the same as H5051 (נֹגַהּ);","strongs_def":"Nogah, a son of David","kjv_def":"Nogah."},
"H5053":{"lemma":"נֹגַהּ","xlit":"nôgahh","pron":"no'-gah","derivation":"(Aramaic) corresponding to H5051 (נֹגַהּ);","strongs_def":"dawn","kjv_def":"morning."},
