"H5055":{"lemma":"נָגַח","xlit":"nâgach","pron":"naw-gakh'","derivation":"a primitive root;","strongs_def":"to butt with the horns; figuratively, to war against","kjv_def":"gore, push (down, -ing)."},
"H5056":{"lemma":"נַגָּח","xlit":"naggâch","pron":"nag-gawkh'","derivation":"from H5055 (נָגַח);","strongs_def":"butting, i.e. vicious","kjv_def":"used (wont) to push."},
"H5057":{"lemma":"נָגִיד","xlit":"nâgîyd","pron":"naw-gheed'","derivation":"or נָגִד; from H5046 (נָגַד);","strongs_def":"a commander (as occupying the front), civil, military or religious; generally (abstractly, plural), honorable themes","kjv_def":"captain, chief, excellent thing, (chief) governor, leader, noble, prince, (chief) ruler."},
